import { Card, Avatar } from "antd";

const UserProfile = () => {
    return (
        <Card
            actions={[
                <div key>
                    <br /> 트윗
                </div>,
                <div key>
                    <br />
                    트윗
                </div>,
                <div key>
                    <br />
                    트윗
                </div>,
            ]}
        >
            <Card.Meta title="Zino" avatar={<Avatar></Avatar>}></Card.Meta>
        </Card>
    );
};

export default UserProfile;
